import { User_Submit } from "./Type";
import { User_Delete } from "./Type";

export const userSubmit = (data) =>{
    return{
        type:User_Submit,
        payload: data
    }
};

export const userDelete = (data) =>{
    return{
        type:User_Delete,
        payload: data
    }
};
